import React, {Component} from 'react';
import { Route } from "react-router-dom";
import Sections from "../sections/Sections";

class App extends Component {
  render() {
    return (
      <div className="App">
        <Header/>
        <Route path="/" component={Sections}/>
        <Footer/>
      </div>
    );  }
}
export default App;
